def rebuild_passphrase(chunks_list):
    b = []
    for c in chunks_list:
        b.extend(c)
    return bytes([x ^ 0x7A for x in b]).decode()

def derive_fernet_key(passphrase, salt_bytes, iterations):
    kdf = PBKDF2HMAC(
        algorithm=hashes.SHA256(),
        length=32,
        salt=salt_bytes,
        iterations=iterations,
        backend=default_backend()
    )
    key = kdf.derive(passphrase.encode())
    return base64.urlsafe_b64encode(key)


